  return (
    <>
      <div className="main_div">
        <div className="center_div">
          <br/>
          <h1> ToDo List </h1>
          <br/>
          <input type="text" placeholder="Add a item" onChange={itemEvent} className=""/>
          <button className="addButton"> + </button>

          <ol className="list">
            <li> {inputList} </li>
          </ol>
        </div>
      </div>

    </>
  )
}
